import { createGlobalStyle } from 'styled-components';
import bbPng from './pieces/bb.png';

const BoardStyle = createGlobalStyle`

    .light-square {
        height: 100px;
        width: 100px;
        background-color: var(--white);
    }

    .dark-square {
        height: 100px;
        width: 100px;
        background-color: var(--purple);
    }

    .img {
        height: 200px;
        width: 200px;
    }

    .board-container {
        display: grid;
        grid-template-columns: 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr;
    }
`

function Board({ gameState }) {

    const pieces_array = gameState.pieces.split('')
    const colors_array = gameState.colors.split('')
    const boardDivs = [];
    for (let i = 0; i < 64; i++) {
        let shade;
        if (i % 2 == 0) {
            shade = 'light'
        } else shade = 'dark';
        boardDivs.push(<div className={`${shade}-square`}></div>)
    }
    console.log(boardDivs)
    console.log(pieces_array)
    console.log(colors_array)

    return (
        <div className='board-container'>
          <BoardStyle />
          <div className="board-container"></div>
          <div className="light-square"></div>
          <div className="dark-square"></div>
          <div className="light-square"></div>
          <div className="dark-square"></div>
